import GlobalStyles from '../components/GlobalStyles';
import { fonts } from '../styles';

export default function Index() {
  return (
    <div>
      <GlobalStyles />
      <h1>Christ the King Anglican Church</h1>
      <style>{`
        h1 {
          font-family: ${fonts.serif};
        }
      `}</style>
    </div>
  )
}
